	modal.getNear = function(itemid) {
		var newarr = [];
		var index = 0;
		var prev = 0;
		var next = 0;
		$.each(modal.items, function(id, obj) {
			newarr[index] = id;
			if(id == itemid) {
				prev = index - 1;
				next = index + 1
			}
			index++
		});
		var pervid = newarr[prev];
		var nextid = newarr[next];
		if(nextid) {
			return nextid
		}
		if(pervid) {
			return pervid
		}
		return false
	};
